import React from 'react';
import './App.css';
import Car from './Car';


function App() {
  const cars = ['Ford', 'BMW', 'Mercedes'];
  return (
    <>
    <div className="App">
      <h1>My Garage</h1>
    </div>
    <ul style={listStyle}>
      {cars.map((car) => <Car brand={car}/>)}
    </ul>
    </>
  );
}

export default App;
